import axios from 'axios';
const myKey = '8701185ffde4f92f44c0abf5011b977c';
axios.defaults.baseURL = 'https://api.themoviedb.org/';
export async function get() {
  const b = await axios.get(`3/movie/?api_key=${myKey}`);
  return b.data;
}
